function digitGrouping(number){

	number = number.toString();

	if (number.indexOf(".") > 0) {
		var decimal = number.slice(number.indexOf(".")+1);
		number = number.slice(0, number.indexOf("."));
	

		switch (number.length) {

			case 4:
				return [number.slice(0, 4-3), ".", number.slice(4-3), ",", decimal].join("");
			case 5:
				return [number.slice(0, 5-3), ".", number.slice(5-3), ",", decimal].join("");
			case 6:
				return [number.slice(0, 6-3), ".", number.slice(6-3), ",", decimal].join("");
			case 7:
				return [number.slice(0, 7-3-3), ".", number.slice(7-3-3, 7-3) , "." , number.slice(7-3), ",", decimal].join("");
			case 8:
				return [number.slice(0, 8-3-3), ".", number.slice(8-3-3, 8-3) , "." , number.slice(8-3), ",", decimal].join("");
			case 9:
				return [number.slice(0, 9-3-3), ".", number.slice(9-3-3, 9-3) , "." , number.slice(9-3), ",", decimal].join("");
			case 10:
				return [number.slice(0, 10-3-3-3), ".", number.slice(10-3-3-3, 10-3-3) , "." , number.slice(10-3-3, 10-3), ".", number.slice(10-3), ",", decimal].join("");
			case 11:
				return [number.slice(0, 11-3-3-3), ".", number.slice(11-3-3-3, 11-3-3) , "." , number.slice(11-3-3, 11-3), ".", number.slice(11-3), ",", decimal].join("");
			case 12:
				return [number.slice(0, 12-3-3-3), ".", number.slice(12-3-3-3, 12-3-3) , "." , number.slice(12-3-3, 12-3), ".", number.slice(12-3), ",", decimal].join("");
			default:
				return number;

		}
	}
	else {
		switch (number.length) {

		case 4:
			return [number.slice(0, 4-3), ".", number.slice(4-3)].join("");
		case 5:
			return [number.slice(0, 5-3), ".", number.slice(5-3)].join("");
		case 6:
			return [number.slice(0, 6-3), ".", number.slice(6-3)].join("");
		case 7:
			return [number.slice(0, 7-3-3), ".", number.slice(7-3-3, 7-3) , "." , number.slice(7-3)].join("");
		case 8:
			return [number.slice(0, 8-3-3), ".", number.slice(8-3-3, 8-3) , "." , number.slice(8-3)].join("");
		case 9:
			return [number.slice(0, 9-3-3), ".", number.slice(9-3-3, 9-3) , "." , number.slice(9-3)].join("");
		case 10:
			return [number.slice(0, 10-3-3-3), ".", number.slice(10-3-3-3, 10-3-3) , "." , number.slice(10-3-3, 10-3), ".", number.slice(10-3)].join("");
		case 11:
			return [number.slice(0, 11-3-3-3), ".", number.slice(11-3-3-3, 11-3-3) , "." , number.slice(11-3-3, 11-3), ".", number.slice(11-3)].join("");
		case 12:
			return [number.slice(0, 12-3-3-3), ".", number.slice(12-3-3-3, 12-3-3) , "." , number.slice(12-3-3, 12-3), ".", number.slice(12-3)].join("");
		default:
			return number;

		}

	}

}

function replaceDecimalMark(roundedPercentage) {
	if (roundedPercentage.indexOf(".") > 0) {
		var decimal;
		decimal = roundedPercentage.slice(roundedPercentage.indexOf(".") + 1);
		roundedPercentage = [roundedPercentage.slice(0, roundedPercentage.indexOf(".")), ",", decimal].join("");								
	}
	return roundedPercentage;
}

