/*
showCountriesByLanguage - gets the value of every checked language (checkbox) in the form and calls showCountry() with the 
parameter countryName as name of every country in which at least one of the selected languages is spoken.
*/
function showCountriesByLanguage(){

	// resets the map
	initialize();

	/*
	* local variables:
	* selection - array of chooseBoxes in HTML form
	* selectedLanguages - array (String) of all selected languages
	* i, j - iteration variables
	* l, l2, l3 - supporting variable for array lengths (performance reasons)
	* maxDistribution - accumulated distribution of all selected languages in a country
	* roundedPercentage - rounded percentage (1 decimal) of relative distribution of speakers in a country
	* color - color to draw and fill country with
	* countriesWithSelectedLanguages - amount of countries with selected languages
	* worldPopulation - world population for calculation
	* languagesInfo - general information about selected languages such as amount of countries where it is spoken and amount of speakers worldwide
	* speakersWorldwide - worldwide speakers of selected language
	*/
	var selection = document["selection-form"].getElementsByTagName('select'), selectedLanguages = [], i, j, l, l2, l3,	maxDistribution, roundedPercentage, color, countriesWithSelectedLanguages = [], worldPopulation = 7200000000, languagesInfo = "", speakersWorldwide = 0;

	// reset div #map-info
	document.getElementById("map-info").innerHTML = "";

	for (i=0; i<selection.length; i++){
		// test if blank
		if (selection[i].value != 'blank'){
			// test if chosen twice
			if (selectedLanguages.indexOf(selection[i].value) < 0) {
				selectedLanguages.push(selection[i].value);
			}
		}
	}
  
	// search country for maxDistribution of every language in selectedLanguages[]
	l = countries.length;
	for(i=0; i<l; i++) {
		maxDistribution = 0;
		l2 = selectedLanguages.length;
		for (j=0; j<l2; j++) {
			l3 = countries[i].languages.length;
			for (k=0; k<l3; k++) {
				if (countries[i].languages[k][0] == selectedLanguages[j]) {
					maxDistribution += countries[i].languages[k][1];
					speakersWorldwide += countries[i].languages[k][1];
					if (countriesWithSelectedLanguages.indexOf(countries[i].countryName) < 0) {
						countriesWithSelectedLanguages.push(countries[i].countryName);						
					}
				}
			}
		}
		// determine color by distribution in percentage
	 	if (maxDistribution > 0) {
	 		roundedPercentage = Math.round(maxDistribution / countries[i].population * 100); // rounded to 0 decimal
	 		color = getColorForPercentage(roundedPercentage);
		}
		else {
			color = "rgb(0,0,0)";
		}

		showCountry(countries[i].countryName, color);

	}
	languagesInfo = "<h3>General information</h3>With the selected languages you can communicate in ";
	if (countriesWithSelectedLanguages.length > 1) {
		languagesInfo = languagesInfo.concat(countriesWithSelectedLanguages.length + " countries.<br>");
	}
	else {
		languagesInfo = languagesInfo.concat(" only one country (" + countriesWithSelectedLanguages[0] + ").<br>");
	}

	languagesInfo = languagesInfo.concat("Worldwide more than " + digitGrouping(speakersWorldwide) + " understand you. These are " +
	replaceDecimalMark((Math.round(speakersWorldwide / worldPopulation * 100 * 100) / 100).toString()) +
	" % of the world population.");

	document.getElementById("map-info").innerHTML += languagesInfo;
}

/*
getColorForPercentage - determines a colour from red over yellow to green conditioned by a percentage (0-100)
*/
function getColorForPercentage (pct) {

	var red = 255, green = 0, i;

	for (i = 0; i < pct; i++) {
		green += 255/50;
		if (i == 50) {
			for (i; i <= pct; i++) {
				red -= 255/50;
			}
		}
	}

	return 'rgb(' + Math.floor(red) + ', ' + Math.floor(green) + ', 0' + ')';
}

/*
showCountry - draws a polygon on the map in the shape for the country. The coordinates are defined by
the coordinates saved in the object variable in the array countries[].
parameters:
	countryName (String): name of the country
	conditionalColouring (Boolean): selection for conditional colouring
*/
function showCountry(countryName, color) {
	/*
	countryParts: array, array for every part of the polygon which is to be drawn
	contentString: String, content of the infoWindow displayed on the map
	selectedCountry: object, the current country which is to be drawn
	width: window / screen width
	*/
	var countryParts = [], contentString, selectedCountry, c, roundedPercentage, decimal, l, width;

	//FIND COUNTRY BY NAME IN OBJ ARRAY
	l = countries.length;
	for (c=0; c<l; c++) {
		if (countries[c].countryName == countryName) {
			selectedCountry = countries[c];
			break;
		}
	}


	// creates a polygon for every selectedCountry part
	l = selectedCountry.countryCoords.length;
	for (c=0; c<l; c++) {
	    // Construct the polygon.
		    countryParts[c] = new google.maps.Polygon({
		    	paths: selectedCountry.countryCoords[c],
		    	strokeColor: color,
		    	strokeOpacity: 0.8,
		    	strokeWeight: 3,
		    	fillColor: color,
		    	fillOpacity: 0.35
		    });
	}

	// draws every selectedCountry part as Polygon
	for (c=0; c<l; c++) {
	    // Construct the polygon.
	    countryParts[c].setMap(map);

	    google.maps.event.addListener(countryParts[c], 'click', function(event) {

	    	/* http://stackoverflow.com/questions/6850164/get-the-device-width-in-javascript */
	    	// window size less than device screen size ?
	    	width = (window.innerWidth > 0) ? window.innerWidth : screen.width;

    	
	    	if (width > 760) {
				/*
				countryName
				Bevölkerung: population
				Sprachen: selectedCountry.languages[0][0] selectedCountry.languages[0][1] selectedCountry.languages[0][2]
				*/
				contentString = '<table style="font-size: 90%;"><tr><td><b>' + selectedCountry.countryName + '</b><td></tr>'
				 + '<tr><td><b>Population:</b></td><td>' + digitGrouping(selectedCountry.population)  + '</td></tr>'
				 + '<tr><td><b>Language</b></td><td><b>Sprecher</b></td><td><b>Distribution</b></td><td><b>Comment</b></td><tr><td>' + selectedCountry.languages[0][0] + '</td>';
				 
				 // speakers = 0 ?
				 	if (selectedCountry.languages[0][1] > 0) {
				 		contentString = contentString.concat('<td style="text-align: right;">' + digitGrouping(selectedCountry.languages[0][1]) + '</td>');
				 	}
				 	else {
				 		// empty table data
				 		contentString = contentString.concat('<td></td>');
				 	}

				// percentage
			 	if (selectedCountry.population > 0 && selectedCountry.languages[0][1] > 0) {
			 		roundedPercentage = Math.round(selectedCountry.languages[0][1] / selectedCountry.population * 100 * 10) / 10; // rounded to 1 decimal
			 		roundedPercentage = roundedPercentage.toString();

			 		roundedPercentage = replaceDecimalMark(roundedPercentage);
					contentString = contentString.concat('<td>' + roundedPercentage + '%</td>');
				}
				else {
					// empty table data
					contentString = contentString.concat('<td></td>');
				}

				// info
				contentString = contentString.concat('</td><td>' + selectedCountry.languages[0][2] + '</td>');

				// close table row
				contentString = contentString.concat('</tr>');

				l = selectedCountry.languages.length; // performance reasons

				// 2nd to n-th language
				for (i=1; i<l; i++) {
				 	
					contentString = contentString.concat('<tr><td>' + selectedCountry.languages[i][0] + '</td>');
					// speakers = 0 ?
				 	if (selectedCountry.languages[i][1] > 0) {
				 		contentString = contentString.concat('<td style="text-align: right;">' + digitGrouping(selectedCountry.languages[i][1]) + '</td>');
				 	}
				 	else {
				 		// empty table data
				 		contentString = contentString.concat('<td></td>');
				 	}

				 	// percentage
				 	if (selectedCountry.population > 0 && selectedCountry.languages[i][1] > 0) {
				 		roundedPercentage = Math.round(selectedCountry.languages[i][1] / selectedCountry.population * 100 * 10) / 10; // rounded to 1 decimal
				 		roundedPercentage = roundedPercentage.toString();

					 	// replace decimal mark
						if (roundedPercentage.indexOf(".") > 0) {
							decimal = roundedPercentage.slice(roundedPercentage.indexOf(".") + 1);
							roundedPercentage = [roundedPercentage.slice(0, roundedPercentage.indexOf(".")), ",", decimal].join("");								
						}
						contentString = contentString.concat('<td>' + roundedPercentage + '%</td>');
					}
					else {
						// empty table data
						contentString = contentString.concat('<td></td>');
					}

				 	// info
				 	contentString = contentString.concat('<td>' + selectedCountry.languages[i][2] + '</td></tr>');
				}

				contentString = contentString.concat('</table>');
					
				// set content of infoWindow in GMaps
				infoWindow.setContent(contentString);
		      	infoWindow.setPosition(event.latLng);

		      	//infoWindow.close();
		      	infoWindow.open(map);
			}
			else {

				//set content of div #map-info
				contentString = '<table><tr><th>' + selectedCountry.countryName + '</th></tr>'
				 + '<tr><td><b>Population</b>: ' + digitGrouping(selectedCountry.population)  + '</td></tr>'

				 l = selectedCountry.languages.length; // performance reasons

				for (i=0; i<l; i++) {
				 	// language name
				 	contentString = contentString.concat('<tr><td class="row-language">' + selectedCountry.languages[i][0] + '</td></tr>');
					 
					 // speakers = 0 ?
					 	if (selectedCountry.languages[i][1] > 0) {
					 		contentString = contentString.concat('<tr><td>' + digitGrouping(selectedCountry.languages[i][1]));
					 		// percentage
						 	if (selectedCountry.population > 0 && selectedCountry.languages[i][1] > 0) {
						 		roundedPercentage = Math.round(selectedCountry.languages[i][1] / selectedCountry.population * 100 * 10) / 10; // rounded to 1 decimal
						 		roundedPercentage = roundedPercentage.toString();

							 	// replace decimal mark
								if (roundedPercentage.indexOf(".") > 0) {
									decimal = roundedPercentage.slice(roundedPercentage.indexOf(".")+1);
									roundedPercentage = [roundedPercentage.slice(0, roundedPercentage.indexOf(".")), ",", decimal].join("");								
								}
								contentString = contentString.concat(' (' + roundedPercentage + '%)</td></tr>');
							}
					 	}

					// info
					if (selectedCountry.languages[i][2] != "") {
						contentString = contentString.concat('<tr><td>' + selectedCountry.languages[i][2] + '</td></tr>');
					}

				}		

				contentString = contentString.concat('</table>');

				//document.getElementById("map-info").style.display = "block";
				document.getElementById("map-info").innerHTML = contentString;
			}

		});	
	}
}

